Cast: Claire, Galas Looner, Heather Monroe
Claire:Here we have the quintessential big city girl. Big city girl as in New York City girl. She`s a cute little number, not much over five foot, but with all of her jiggly parts size proportionate and appropriately jiggly. Claire`s big city act got old pretty fast however. But a briskly smacked bottom fixed that in no time, even though our man then insisted on continuing to spankthat very same bottom for quite a while longer.Heather Monroe:She`s one of those rare breeds who look equally at home adorning the covers of Men`s and Women`s Magazines alike. She did, however, look a tad out of place in the cheesy New Jersey motel that sometimes doubles as our studio.But hey! A locale is a locale and a big fat modeling fee is a big fat modeling fee, right? Not necessarily. Or so it would seem, judging by the lady`s sassy verbiage and staggering lack of anything even resembling motivation. Our man however lacked not in the least for motivation.Galas Looner:Your RSVP to a gala butt blistering !We sent this young lady her invitation just a little over a month before that happy day. Of course, her invitationwasn`t spelled out quite like that, but we were quite confident that the tart`s conduct would be such so as to ensure that it played out exactly like that.
